            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤌ ተખ उઞꤌ𐌻, પተ꤀ ꤐꤣપ ꤙꤕрꤕმꤌёተꤍꤎ ꤙ꤀ ꤀પӄγ ꤣ ꤐꤌ꤅ꤣઞꤕ, ꤐ꤀ተ ꤎ ӄ꤀꤅მꤌ ꤕꤒꤌ𐌻 ተꤐ꤀ળ 𐌼ꤌተ𑀨 ꤒꤕउ ꤅ꤌઞმ꤀ઞꤌ ,ꤍተ꤀ рꤌउ ꤙꤕрꤕӄрꤕꤍተꤣ𐌻ꤍꤎ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
