            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤕꤒꤌઞખ꤇ рખꤟꤌр𑀨 ꤍ ꤙꤣउმꤌӄ꤀𐌼 ꤍꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ӄꤌӄ ꤍ ൰ꤣተ꤀𐌼 ઞꤌ ꤙ𐌻ꤕપꤕ ꤀ተ ઞꤌꤙꤌმꤕઞꤣꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ?) ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 , ተ꤀ પተ꤀ ꤙꤣउმꤌӄ ተꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ꤒγმꤕተ ꤣउ𐌼ꤕઞёઞ 𐌼꤀ꤣ𐌼 𑀋γё𐌼 , ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 , ተ꤀ પተ꤀ ꤎ ꤒγმγ ꤙ꤀ ꤍተꤕꤙꤕઞઞ꤀ ꤕꤒꤌተ𑀨 ꤕё ꤐꤍё ꤍꤣ𐌻𑀨ઞꤕꤕ ꤣ ꤍꤣ𐌻𑀨ઞꤕꤕ પተ꤀ꤒખ ꤀ઞꤌ उꤌ꤅ꤣꤒꤌ𐌻ꤌꤍ𑀨 ꤀ተ ꤀р꤅ꤌउ𐌼ꤌ , ω𐌻ળ𑀋ꤌ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤒ𐌻ꤎ ))) ተખ ӄꤌӄ ꤕꤒꤌઞꤌꤎ ωӄꤌተγ𐌻ӄꤌ 𑀋рꤌઞꤣω𑀨 𐌼꤀꤇ 𑀋γ꤇ γ ꤍꤕꤒꤎ ꤐ꤀ рተγ ꤣ ꤙрꤣ ᤋተ꤀𐌼 ꤍ꤀ꤍёω𑀨 𐌼ઞꤕ ꤕ꤅꤀ ꤍꤐ꤀ꤣ𐌼 მખрꤎꤐખ𐌼 ꤎउખપӄ꤀𐌼  <emoji document_id=5021558484106216371>✨️</emoji>]",
