            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤙ꤀પꤕ𐌼γ ተખ ꤙ𑀨ꤕω𑀨 𐌼꤀ળ ӄ꤀ઞપγ ꤙ꤀ γተрꤌ𐌼 उꤌ𐌻ꤙ꤀𐌼?) [<emoji document_id=5021558484106216371>✨️</emoji>]",
