            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐌿ꤌ𐌟ꤌрળ ተꤕꤒꤎ ઞꤌ ꤍӄ꤀ꤐ꤀р꤀მӄꤕ, ꤐ𐌼ꤕꤍተꤕ ꤍ ꤍꤌ𐌻꤀𐌼 ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤣ ꤎ꤇ꤟꤌ𐌼ꤣ ተꤐ꤀ꤕ꤅꤀ ꤀ተꤟꤌ ꤣ ꤍӄ꤀р𐌼𐌻ળ ተꤕꤒꤎ ተꤐ꤀ꤕ꤇ ꤒꤌꤒγωӄꤕ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐌄ተ꤀ ተꤐ꤀꤇ ꤙрꤕმꤕ𐌻 ꤒрꤌተળઞ𑀨, ተꤐ꤀꤇ 𐌼꤀उ꤅ ઞꤌ ꤅рꤌઞꤣ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐌓 𐌼ꤣउꤌઞተр꤀ꤙ, ꤙ꤀ተ꤀𐌼γ પተ꤀ ተꤌӄꤣꤕ ӄꤌӄ ተખ ઞꤌउખꤐꤌળተ ꤍꤕꤒꤎ 𐌻ળმ𑀨𐌼ꤣ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐌱ꤕმꤕω𑀨 ꤍꤕꤒꤎ ꤅𐌻γꤙ꤀, ተγꤙ꤀, ꤌ𐌼꤀рꤌ𐌻𑀨ઞ꤀, ꤐ ꤀ꤒ൰ꤕ𐌼 ተખ ꤙр꤀ꤍተꤣተγተӄꤌ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𑀗მꤌተ𑀨 ተꤕꤒꤎ ઞꤌ 𐌼ꤎꤍ꤀ӄ꤀𐌼ꤒꤣઞꤌተ उઞꤌપꤣተ ꤀ꤒꤕꤍꤙꤕપꤣተ𑀨 𐍅ӄрꤌꤣઞγ ꤍꤌ𐌻꤀𐌼 ઞꤌ ተрꤣ ꤅꤀მꤌ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𑀥ꤕმ 𐌼꤀р꤀उꤌ ઞꤕተ ꤒрꤌተꤣωӄꤌ, પγმꤌ ઞꤕ ꤍ𐌻γપꤣተꤍꤎ ꤣ ተખ ꤍઞ꤀ꤐꤌ ꤍ꤀𐌻𑀨ꤕω𑀨ꤍꤎ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐌑ꤌ𐌼γ ꤕꤒꤌ𐌻? 𐌀 ꤎ, ઞꤕተ. [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𐋏ꤕ ꤕꤒꤌ𐌻 ተꤐ꤀ળ 𐌼ꤌ𐌼γ, ꤙ꤀ተ꤀𐌼γ પተ꤀ ꤀ઞꤌ р꤀𐌟ꤌꤕተ ꤐખр꤀მӄ꤀ꤐ! [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ઞꤌωё𐌻 ઞ꤀ꤐખ꤇ ꤍꤙ꤀ꤍ꤀ꤒ ꤣꤍꤙ꤀𐌻𑀨उ꤀ꤐꤌઞꤣꤎ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤎ ተꤕꤙꤕр𑀨 ꤐꤕωꤌળ ꤕё उꤌ𐌼ꤕꤍተ꤀ ꤐખӄ𐌻ળપꤌተꤕ𐌻ꤎ, ꤣ 𑀋γꤎрળ 𑀋γꤕ𐌼 ꤙ꤀ ꤙꤣउმꤕ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ꤣ ꤍрꤌउγ 𐌟ꤕ ꤐӄ𐌻ળપꤌꤕተꤍꤎ ꤍꤐꤕተ ꤐ ӄ꤀𐌼ઞꤌተꤕ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            '[<emoji document_id=5021558484106216371>✨️</emoji>] ӄꤍተꤌተꤣ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤒꤕрꤕተ 𐌼꤀꤇ 𑀋γ꤇ ꤐ рγӄγ ꤣ ꤀рꤕተ "𑀗𐌻ꤌꤐꤌ 𐍅ӄрꤌꤣઞꤕ" [<emoji document_id=5021558484106216371>✨️</emoji>]',
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ӄ꤀꤅მꤌ ꤍ꤀ꤍёተ 𐌼꤀꤇ પ𐌻ꤕઞ, ꤍрꤌउγ ઞꤌપꤣઞꤌꤕተ მꤌꤐꤣተꤍꤎ ꤙ꤀પꤕ𐌼γ, ꤀მઞꤌ𐌟მખ ꤕ꤇ ꤙрꤣω𐌻꤀ꤍ𑀨 उꤌωꤣꤐꤌተ𑀨 ꤅꤀𐌻꤀ꤐγ, ꤙ꤀ꤍ𐌻ꤕ ተ꤀꤅꤀ ӄꤌӄ ꤎ ꤍ𐌻γપꤌ꤇ઞ꤀ ꤙр꤀ꤒꤣ𐌻 ꤕ꤇ उꤌተખ𐌻꤀ӄ 𑀋γꤕ𐌼 ӄ꤀꤅მꤌ ꤀ઞꤌ 𐌼꤀꤇ પ𐌻ꤕઞ ꤍ꤀ꤍꤌ𐌻ꤌ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] γ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤀მꤣઞꤌрઞખ꤇ рꤌꤍꤙ꤀рꤎმ꤀ӄ მઞꤎ, ꤍ꤀ꤍꤌተ𑀨 𐌼꤀꤇ 𑀋γ꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ઞγ ꤙр꤀ꤍተ꤀ ꤎ ꤐપꤕрꤌ ઞꤌꤍꤍꤌ𐌻 ઞꤌ ꤙꤣउმγ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤣ 𐌼ઞꤕ ӄꤌ𐌟ꤕተꤍꤎ પተ꤀ ꤒрꤌተꤣӄꤌ γ ተꤕꤒꤎ ઞꤕ ꤒγმꤕተ ꤣꤒ꤀ ꤎ ꤕ꤅꤀ उꤌተꤙꤣ𐌻?? [<emoji document_id=5021558484106216371>✨️</emoji>]",
            '[<emoji document_id=5021558484106216371>✨️</emoji>] ઞγ ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 પተ꤀ ӄ꤀꤅მꤌ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤍ𐌻γωꤌꤕተ Ա꤀ꤎ "उꤐꤕउმꤌ ꤙ꤀ ꤣ𐌼ꤕઞꤣ ꤍ꤀𐌻ઞꤟꤌ" ተ꤀ ꤀ઞꤌ ꤙрꤕმꤍተꤌꤐ𐌻ꤎꤕተ 𐌼꤀꤇ 𑀋γ꤇ ઞꤌმ ꤍꤐ꤀ꤕ꤇ ꤙꤣउმ꤀꤇ ӄ꤀ተ꤀рખ꤇ ꤍꤐꤕተꤣተ ꤍꤕꤐꤕрઞખ𐌼 ꤍꤣꤎઞꤣꤕ𐌼? ( [<emoji document_id=5021558484106216371>✨️</emoji>]',
            '[<emoji document_id=5021558484106216371>✨️</emoji>] ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, ӄ꤀꤅მꤌ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤐꤣმꤣተ 𐌼꤀꤇ 𑀋γ꤇, ꤀ઞꤌ ꤍрꤌउγ 𐌟ꤕ ઞꤌપꤣઞꤌꤕተ ꤍꤌმꤣተꤍꤎ ઞꤌ ӄ꤀𐌻ꤕઞꤣ, ꤣ ꤙр꤀ӄ𐌻ꤌმખꤐꤌተ𑀨 ӄрꤌꤍઞγળ მ꤀р꤀𐌟ӄγ მ𐌻ꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ ӄ ꤕё ꤙꤣउმꤕ? 𐌀 ӄꤌӄ ተ꤀𐌻𑀨ӄ꤀ ꤎ ઞꤌપꤣઞꤌળ ꤙ꤀მꤍተꤌꤐ𐌻ꤎተ𑀨 ӄ ઞꤕ꤇ ꤍꤐ꤀꤇ 𑀋γ꤇, ꤀ઞꤌ ꤟꤕ𐌻γꤕተ 𐌼ઞꤕ उꤌ𐌻γꤙγ, ꤣ ꤙрꤣ꤅꤀ꤐꤌрꤣꤐꤌꤕተ "उმрꤌꤐꤍተꤐγ꤇ ꤀ 𐌱ꤕ𐌻ꤣӄꤣ꤇" ?? [<emoji document_id=5021558484106216371>✨️</emoji>]',
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ઞγ ꤌр꤀ꤍተ꤀ ꤙ꤀꤇𐌼ꤣ પተ꤀ ꤕꤍ𐌻ꤣ ተખ ꤍꤕ꤇પꤌꤍ ઞꤕ ꤀ተӄꤌ𐌟ꤕω𑀨ꤍꤎ ꤀ተ მ꤀उખ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ ꤐ ተꤐ꤀ꤕ꤇ р꤀ተ꤀ꤐ꤀꤇ ꤙ꤀𐌻꤀ꤍተꤣ ተ꤀ ꤎ ꤒγმγ ꤐખઞγ𐌟მꤕઞ γꤕꤒꤌተ𑀨 ꤍꤐ꤀ꤣ𐌼ꤣ ꤎ꤇ꤟꤌ𐌼ꤣ ꤙ꤀ ተꤐ꤀ꤕ𐌼γ მꤕተꤍӄ꤀𐌼γ ꤌઞγꤍγ? ) ꤣ ꤎ ꤒγმγ ꤒꤣተ𑀨 ꤙ꤀ ઞꤕ𐌼γ ꤙ꤀ӄꤌ ꤀ઞ ઞꤕ ꤙꤕрꤕꤍተꤌઞꤕተ ꤐ꤀ઞꤎተ𑀨 рખꤒ꤀꤇?) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ઞγ उꤌ𐌼ꤕተ𑀨, પተ꤀ ꤙ꤀ꤍ𐌻ꤕ ተ꤀꤅꤀ ӄꤌӄ ꤎ ꤕꤒγ ተꤐ꤀ળ 𐌼ꤌተ𑀨, γ ઞꤕё ꤣउ ꤙꤣउმખ ꤕ൰ё ꤐ ተꤕપꤕઞꤣꤣ ተрё𑀋 પꤌꤍ꤀ꤐ 𐌼꤀ꤎ ꤍꤙꤕр𐌼ꤌ ꤐખተꤕӄꤌꤕተ, ꤣ ꤀ઞꤌ ꤕ𐌻ꤕ 𑀋꤀მꤣተ, ꤙрꤣ𑀋꤀მꤣተꤍꤎ ꤕё ઞꤌ 𑀋γꤕ მ꤀𐌼꤀꤇ ተꤌ൰ꤣተ𑀨) 𐌕ꤌ𐌼 ተખ ꤍꤐ꤀ꤣ𐌼 ꤎउખӄ꤀𐌼 ꤟꤕꤙ𐌻ꤎꤕω𑀨 ꤕё ӄ𐌻ꤣተ꤀р ꤣ ተꤌ൰ꤣω𑀨 ꤕё მ꤀ ӄр꤀ꤐꤌተꤣ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 પተ꤀ ꤎ ઞꤌ ꤙꤣउმꤌ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤙ꤀ꤐꤕꤍꤣ𐌻 ꤍӄрખተγળ ӄꤌ𐌼ꤕрγ ӄ꤀ተ꤀рꤌꤎ ꤙрꤣ ꤕꤕ ꤙ꤀𑀋꤀მӄꤕ ꤙ꤀ӄꤌउખꤐꤌꤕተ ꤙр꤀ꤟꤕઞተ ꤐખተꤕӄꤌઞꤣꤎ 𐌼꤀ꤕ꤇ ꤍꤙꤕр𐌼ખ ꤣउ ꤕꤕ ꤐ𐌻ꤌ꤅ꤌ𐌻ꤣ൰ꤌ? ( [<emoji document_id=5021558484106216371>✨️</emoji>]",
