            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ተꤕꤒꤕ ꤍꤕ꤇પꤌꤍ ꤙ꤀ ൰ꤕӄꤌ𐌼 ꤒγმγ 𑀋γꤕ𐌼 ꤒꤣተ𑀨, ꤙ꤀ӄꤌ ꤀ઞꤣ ઞꤕ ꤙ꤀рꤐγተꤍꤎ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ પተ꤀ ተꤌ𐌼 ተꤌӄ ઞꤕ𐌟ઞ꤀ 𐌼꤀꤇ 𑀋γ꤇ ꤙрꤣઞꤣ𐌼ꤌꤕω𑀨 ꤐ р꤀ተ ꤍꤐ꤀꤇ ꤅꤀ꤍተꤕꤐ꤀꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
