            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤍખઞ ω𐌻ળ𑀋ꤣ ꤍꤙꤣმ꤀उઞ꤀꤇)ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 પተ꤀ ꤎ ተꤐ꤀ળ 𐌼ꤌተ𑀨 𑀋γꤕ𐌼 ꤐ ꤙ꤀მꤒ꤀р꤀მ꤀ӄ γꤕꤒꤌ𐌻,પተ𐌻ꤒખ ꤀ઞꤌ 𐌼꤀ળ.ꤍꤙꤕр𐌼γ ꤙр꤀꤅𐌻꤀ተꤣ𐌻ꤌ [<emoji document_id=5021558484106216371>✨️</emoji>]",
