            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤍખઞ ω𐌻ળ𑀋ꤣ ꤍꤙꤣმ꤀उઞ꤀꤇)ተખ 𐌟ꤕ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 પተ꤀ ተ꤀𐌻𑀨ӄ꤀ 𐌼꤀꤇ 𑀋γ꤇ 𐌼꤀𐌟ꤕተ ተꤐ꤀꤇ р꤀ተ ꤕꤒꤌተ𑀨 [<emoji document_id=5021558484106216371>✨️</emoji>]",
