            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ 𐌟ꤕ ተꤕꤒꤕ ꤀ꤒ ꤍꤐ꤀꤇ 𑀋γ꤇ ꤍተγӄઞγ ተꤐ꤀ꤣ𐌼 рተ꤀𐌼, પተ꤀ ተખ ꤙꤌ𐌼ꤎተꤣ 𐌻ꤣωꤣω𑀨ꤍꤎ ꤣ ꤙ꤀꤇მёω𑀨 ꤐ ꤒ꤀𐌻𑀨ઞꤣꤟγ, પተ꤀ꤒખ ተꤕꤒꤕ ꤕꤕ ꤐ꤀ꤍꤍተꤌઞ꤀ꤐꤣ𐌻ꤣ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ተꤌӄ ꤍተрꤌઞઞ꤀ ઞꤌ 𐌼꤀꤇ 𑀋γ꤇ ꤙр꤀꤅𐌻ꤎმખꤐꤌꤕω𑀨, ꤎ ꤐꤣ𐌟γ પተ꤀ ተખ ꤐउ꤅𐌻ꤎმ꤀𐌼 ꤕ꤅꤀ γ𐌟ꤕ ꤀ተꤍ꤀ꤍꤌ𐌻) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤐ𐌻ꤌმꤕ𐌻𑀨ꤟγ પꤕꤒγрꤕપઞ꤀꤇ ꤀ተꤍꤌꤍખꤐꤌꤕተ, उꤌ ꤒꤕꤍꤙ𐌻ꤌተઞખ꤇ ꤀ꤒꤕმ, ꤙ꤀ꤍ𐌻ꤕ ꤒ𐌻ꤎმ꤀ӄ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀꤇𐌼ꤣ, પተ꤀ ꤎ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ მꤕ𐌻ꤌળ γꤍ𐌻γ꤅γ, પተ꤀ꤒખ ꤀ઞꤌ 𐌼꤀꤅𐌻ꤌ ꤙ꤀ꤍተ꤀ꤎઞઞ꤀ 𐌼꤀꤇ 𑀋γ꤇ ꤍ꤀ꤍꤌተ𑀨 ꤣ ઞꤕ ꤍተꤕꤍઞꤎተ𑀨ꤍꤎ ꤐ ꤙр꤀ꤍ𑀨ꤒꤕ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተખ 𐌻꤀𑀋γωӄꤌ ꤕꤒꤌઞઞꤌꤎ, ӄ꤀ተ꤀рꤌꤎ 𐌼ꤕმ𐌻ꤕઞઞ꤀ ꤙꤣωꤕተ, ꤙ꤀ተ꤀𐌼γ પተ꤀ ꤕ𐌼γ પ𐌻ꤕઞ 𐌼꤀꤇ ꤐ 𐌟꤀ꤙꤕ 𐌼ꤕωꤌꤕተ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤐ ӄγрꤍꤕ, પተ꤀ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ઞꤌ ꤍተр꤀꤇ӄꤕ рꤌउрꤕωꤣ𐌻ꤌ 𐌼ઞꤕ рꤌउ𐌼ꤕꤍꤣተ𑀨 ꤐ ꤕё ꤙꤣउმꤕ рꤌꤍተꤐ꤀р, પተ꤀ꤒખ მ꤀𐌼 ꤍ𐌻꤀𐌟ꤣተ𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ተꤕꤒꤎ ꤍꤕ꤇પꤌꤍ ꤍꤐ꤀ꤣ𐌼 𑀋γꤕꤍ ωꤐખрꤌઞγ ꤐ ꤒγმӄγ, ൰ꤕઞ꤀ӄ, પተ꤀ꤒખ ተખ ઞꤕ ተꤎꤐӄꤌ𐌻 ઞꤌ 𐌼꤀꤇ 𑀋γ꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤍꤕ꤇પꤌꤍ ꤙ꤀მ 𐌼꤀꤇ 𑀋γ꤇ ꤙ꤀მꤍተрꤣ꤅𐌻ꤌꤍ𑀨, ꤍმꤕ𐌻ꤌ𐌻ꤌ ꤙγપ꤀ӄ, ӄꤌӄ ઞꤌ 𐌻꤀ꤒӄꤕ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ꤍꤕ꤇પꤌꤍ ተꤕꤒꤕ ꤐ ꤕꤒꤌ𐌻꤀ ꤍ 𑀋γꤎ 𑀋ꤌрӄઞγ, પተ꤀ꤒખ ተખ ꤙ꤀ઞꤎ𐌻, પተ꤀ ꤎ ተꤐ꤀꤇ 𑀋꤀उꤎꤣઞ, ꤌ ተખ 𐌼꤀ꤎ ꤍ꤀ꤒꤌӄꤌ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተખ ϕꤌઞꤌተꤕꤕω𑀨 ꤀ተ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ, ӄꤌӄ ꤎрખ꤇ ϕꤌઞꤌተ 𐌼꤀ꤕ꤇ उꤌ𐌻γꤙખ ઞꤌ ꤐꤍꤕ ꤕꤒ𐌻ꤣ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ ꤙ꤀ӄγꤙꤌꤕω𑀨 ꤒꤣ𐌻ꤕተખ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ተꤕꤒꤎ ꤍꤕ꤇પꤌꤍ ꤒγმγ ꤕꤒꤌተ𑀨 ઞꤌ ꤐꤍળ ꤐખმꤕр𐌟ӄγ, પተ꤀ꤒખ ተખ ꤙ꤀ઞꤎ𐌻 , પተ꤀ ઞꤌ 𐌼꤀꤇ 𑀋γ꤇ ꤐꤎӄꤌተ𑀨 ꤒꤕꤍꤙ꤀𐌻ꤕउઞ꤀) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙр꤀ꤍተ꤀ ꤍꤕ꤇પꤌꤍ 𐌼꤀꤇ 𑀋γ꤇ ꤍ꤀ꤍꤣрγꤕω𑀨 ꤣ ઞꤌꤙ꤀𐌼ꤣઞꤌꤕω𑀨 ꤒખ𐌻ખꤕ ꤐрꤕ𐌼ꤕઞꤌ ꤙр꤀ꤐꤕმёઞઞખꤕ ꤍ ተꤐ꤀ꤕ꤇ 𐌼ꤌተꤕр𑀨ળ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ उઞꤌ𐌻, પተ꤀ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 𐌼꤀꤇ 𑀋γ꤇ ꤍ꤀ꤍꤌ𐌻ꤌ, ӄ꤀꤅მꤌ მꤌ 𐌼ખ ꤕ൰ё ꤐ ωӄ꤀𐌻ꤕ γપꤣ𐌻ꤣꤍ𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ꤎ ተꤕꤒꤎ 𑀋γꤕ𐌼 ꤣꤍተрꤕꤒ𐌻ળ, ӄꤌӄ ተꤕрр꤀рꤣꤍተ꤀ꤐ) ꤙ꤀ተ꤀𐌼γ પተ꤀ ተખ ꤙрꤕმꤍተꤌꤐ𐌻ꤎꤕω𑀨 γ꤅р꤀उγ მ𐌻ꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ ተꤕ𐌼 ꤍꤙ꤀ꤍ꤀ꤒ꤀𐌼, પተ꤀ ꤙрꤣӄγꤍખꤐꤌꤕω𑀨 ωӄγрӄγ ઞꤌ 𑀋γꤕ 𐌼꤀ꤕ𐌼 ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤍꤕ꤇પꤌꤍ उꤌ𑀋𐌻ꤕꤒઞёω𑀨ꤍꤎ 𐌼꤀ꤕ꤇ ꤍꤙёр𐌼꤀꤇ , 𐌼꤀рꤎӄ ተખ ꤕꤒꤌઞઞખ꤇ , ꤍተγꤙꤌ꤇ ꤍꤐ꤀ꤣ𐌼 рተ꤀𐌼 ꤙ꤀ 𐌼꤀ꤕ𐌼γ 𑀋γળ, પተ꤀ꤒખ ꤎ ተꤕꤒꤎ ઞꤕ ꤐꤣმꤕ𐌻) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤍ𐌻γωꤌ꤇ ꤍળმꤌ, ൰ꤕઞ꤀ӄ , ꤎ ተꤕꤒꤎ ꤕꤒγ ꤣ ꤒγმγ ꤙ꤀ꤍተ꤀ꤎઞઞ꤀ ꤙꤣઞꤌተ𑀨, ꤙ꤀ተ꤀𐌼γ પተ꤀ ተખ उꤌ𐌻γꤙઞખ꤇ ӄ𐌻ꤕ൰𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ꤎ ተꤕꤒꤎ ꤒγმγ ઞꤌ ꤐꤍꤕ 20 પꤌꤍ꤀ꤐ рꤌꤍተꤎ꤅ꤣꤐꤌተ𑀨 ઞꤌ ꤍꤐ꤀ё𐌼 𑀋γꤕ, ӄꤌӄ ꤙр꤀ꤍተખઞӄγ ) ꤌ ተખ ꤒγმꤕω𑀨 ꤙ𐌻ꤌӄꤌተ𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ꤎ ተꤕꤒꤕ ꤍꤕ꤇પꤌꤍ ꤐ ꤌઞꤌ𐌻 ꤍꤐ꤀꤇ 𑀋γ꤇ ꤐ꤀ተӄઞγ, ӄꤌӄ 𐌼ꤕપ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤍખઞ ω𐌻ળ𑀋ꤣ ꤍꤙꤣმ꤀उઞ꤀꤇)ተખ ઞꤌ𑀋γꤎ ꤍꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωӄꤕ ꤐ ꤙꤣउმγ ӄ꤀ઞપꤣ𐌻,ꤙꤣउმ꤀ӄрખ𐌻 ተખ ꤕꤒꤌઞખ꤇) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤍ𐌻γωꤌ꤇, 𐌼꤀𐌟ꤕተ ተખ 𐌼ઞꤕ 𑀋γ꤇ ꤍꤐ꤀ꤣ𐌼 ꤅꤀р𐌻꤀𐌼 ઞꤌተрꤕω𑀨, ӄꤌӄ ꤐꤕ𑀋꤀ተӄ꤀꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ተꤕꤒꤎ ꤍꤕ꤇પꤌꤍ ꤐ ꤕꤒ𐌻꤀ ꤐꤍተꤌꤐ𐌻ળ 𑀋γ꤇, ӄꤌӄ ӄ𐌻ળપ ꤐ 𐌼ꤌωꤣઞγ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ પተ꤀ γ൰ꤕрꤒઞꤌꤎ ተꤌӄꤌꤎ, ꤌ ઞγ ꤍ𑀨ꤕꤒꤌ𐌻ꤍꤎ, ꤙ꤀ӄꤌ 𐌼꤀꤇ 𑀋γ꤇ მ꤀ꤒр ӄ ተꤐ꤀ꤕ𐌼γ ઞꤌγપγ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ 𑀋γ𐌻ꤣ 𐌼꤀꤇ 𑀋γ꤇ ꤍꤐ꤀ꤣ ꤌઞꤌ𐌻꤀𐌼 ꤀ꤒઞꤣ𐌼ꤌꤕω𑀨, ӄꤌӄ ꤍꤐ꤀ꤕ꤅꤀ ꤀ተꤟꤌ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተખ ꤍ ӄꤌꤙꤍ꤀𐌼 ꤣ ωꤌꤙӄ꤀꤇ 𐌼꤀꤇ 𑀋γ꤇ მ꤀ ᤋ꤇ϕ꤀рꤣꤣ მ꤀ꤐꤕმёω𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ꤎ ꤍꤕ꤇પꤌꤍ ꤍꤐ꤀꤇ 𑀋γ꤇ ꤒγმγ მꤌꤐꤌተ𑀨 ઞꤕ 𐌻ꤣω𑀨 ተꤕꤒꤕ ઞ꤀ ꤣ ተꤐ꤀ꤕ𐌼γ მрγ꤅γ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𑀋γ𐌻ꤣ ተખ 𐌼ઞꤕ ꤐ 𑀋γ꤇ ꤙ𐌻ꤌપꤕω𑀨, ӄꤌӄ ተꤕ𐌻ӄꤌ ꤕꤒꤌઞઞꤌꤎ, γ𐌟ꤕ 𐌼ઞꤕ उꤌ𐌻γꤙγ ꤙр꤀𐌼꤀પꤣ𐌻) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተખ ꤍ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ, ӄꤌӄ પꤕωγꤎ ꤍꤙ꤀𐌻उёω𑀨 ꤣ ꤍꤙꤌተ𑀨 ꤀ተꤙрꤌꤐꤣω𑀨ꤍꤎ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ઞꤕ ઞγ ꤌ પꤕ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 𐌼ઞꤕ ꤍ꤀ꤍꤕተ ꤒꤕउ ꤙꤕрꤕმખωӄꤣ, ꤀પꤕઞ𑀨 ተખ ꤕꤒꤌઞઞખ꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ 𑀋γ𐌻ꤣ 𐌼꤀꤇ 𑀋γ꤇ ꤍꤐ꤀ꤣ𐌼 рተ꤀𐌼 ꤙ꤀उ꤀рꤣω𑀨) ꤍъꤕꤒꤣꤍ𑀨 ꤐ ꤒγმӄγ ൰ꤕઞ꤀ӄ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀꤇𐌼ꤣ, પተ꤀ ተꤐ꤀ё ꤙрꤣउꤐꤌઞꤣꤕ 𐌼ઞꤕ ꤐ 𑀋γ꤇ მγმꤕተ𑀨 ꤐ꤀ ꤐрꤕ𐌼ꤎ ꤒꤕ꤅ꤍተꤐꤣ꤇, પ𐌻ꤕઞ꤀꤅𐌻꤀ተ ተખ ꤀ꤙγ൰ꤕઞઞખ꤇ ) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] 𑀋γ𐌻ꤣ ተખ ተꤌ𐌼 ꤍꤙрꤎተꤌ𐌻ꤍꤎ उꤌ ꤙꤣउმꤌӄ ꤍꤐ꤀ꤕ꤇ 𐌼ꤌተꤕрꤣ, ωꤌ𐌻ꤌꤐખ ꤕꤒꤌઞઞ꤀꤇) [<emoji document_id=5021558484106216371>✨️</emoji>]",
            "[<emoji document_id=5021558484106216371>✨️</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ꤎ ተꤕꤒꤕ ꤀ተ𐌟ꤌрળ, ӄꤌӄ ω𐌻ળωӄγ) પተ꤀ ተખ ꤒγმꤕω𑀨 ꤐ ꤍተрꤌ𑀋ꤕ ꤀ተ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ γꤒꤕ꤅ꤌተ𑀨) [<emoji document_id=5021558484106216371>✨️</emoji>]",
