            "[<emoji document_id=5361609594894296234>🌕</emoji>] ꤎ ꤒ𐌻ꤎმ𑀨 ઞꤌωё𐌻 ተꤐ꤀ળ 𐌼ꤌ𐌼ꤌωӄγ ઞꤌ ተрꤌꤍꤍꤕ, ӄꤌӄ ꤍ꤀ተӄγ ꤐ उꤣ𐌼ઞꤕ꤇ ӄγрተӄꤕ, рꤌउઞꤣꤟꤌ ꤒ꤀𐌻𑀨ωꤌꤎ, ઞ꤀ рꤌმ꤀ꤍተ𑀨 ꤀მꤣઞꤌӄ꤀ꤐꤌꤎ ) [<emoji document_id=5361609594894296234>🌕</emoji>]",
