            "[<emoji document_id=5361609594894296234>🌕</emoji>] ꤐ꤀ተ ꤍ𐌼꤀ተрꤣ,ተખ ꤀მꤣઞ꤀ӄ, ꤐꤕმ𑀨 𐌼꤀꤇ 𑀋γ꤇ ઞꤕ उꤌ꤅𐌻ꤎმખꤐꤌꤕተ ꤒ꤀𐌻𑀨ωꤕ ꤐ ተꤐ꤀꤇ р꤀ተ ઞꤌ પꤌ꤇,ተꤕꤒꤕ ꤅рγꤍተઞ꤀, ꤐꤕმ𑀨 𐌼꤀꤇ 𑀋γ꤇ ꤀ӄ꤀ઞપꤣ𐌻 ꤀ተઞ꤀ωꤕઞꤣꤕ ꤍ ተꤐ꤀ꤕ꤇ ꤅γꤒ꤀꤇, ꤀ઞꤣ ꤒ꤀𐌻𑀨ωꤕ ઞꤕ ꤙꤌрꤌ) [<emoji document_id=5361609594894296234>🌕</emoji>]",
            "[<emoji document_id=5361609594894296234>🌕</emoji>] ꤙ꤀ω𐌻ꤣ ઞꤌ 𐌼꤀ઞꤕተઞખ꤇ მꤐ꤀р,ተખ γउઞꤌꤕω𑀨 उꤌ પተ꤀ ꤙ꤀ӄγꤙꤌળተ ተꤐ꤀ળ 𐌼ꤌተ𑀨, ꤙр꤀ꤍተꤣ,ꤎ ઞꤕ 𑀋꤀ተꤕ𐌻 ተꤕꤒꤎ ꤀ꤒꤣმꤕተ𑀨, ઞ꤀ р꤀ተ ተꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ,ӄꤌӄ ꤙр꤀𑀋꤀მઞ꤀꤇ მꤐ꤀р, ઞγ 𑀋γꤣ પꤌꤍተ꤀ उꤌ꤅𐌻ꤎმખꤐꤌળተ ઞꤌ પꤌ꤇) [<emoji document_id=5361609594894296234>🌕</emoji>]",
            "[<emoji document_id=5361609594894296234>🌕</emoji>] მ꤀ꤙγꤍተꤣ𐌼,ꤎ ꤐખꤕꤒγ ተꤐ꤀ળ 𐌼ꤌተ𑀨,ꤌ მꤌ𐌻𑀨ωꤕ પተ꤀?) ꤎ 𐌟ꤕ ꤒр꤀ωγ ꤕё, ꤀ઞꤌ 𑀋γꤕተꤌ ꤒ𐌻ꤎ, ꤎ ઞꤕ ꤒγმγ ꤍ ઞꤕ꤇ ) [<emoji document_id=5361609594894296234>🌕</emoji>]",
            "[<emoji document_id=5361609594894296234>🌕</emoji>] ꤒ𐌻ꤎ, પγꤐꤌӄ, ӄꤌӄ ꤒખ ꤍӄꤌउꤌተ𑀨 𐌼ꤎ꤅પꤕ, ઞγ ꤕꤒꤌ𐌻 ꤎ ተꤐ꤀ળ 𐌼ꤌተ𑀨,ꤣ પ꤀?) ꤍӄꤌઞმꤌ𐌻 उꤌꤐ꤀მꤣተ𑀨? ) ઞꤌ𑀋γ꤇ ꤍተ꤀𐌻𑀨ӄ꤀ ωγ𐌼ꤌ ꤙ꤀მઞꤣ𐌼ꤌተ𑀨 ꤣउ उꤌ ተ꤀꤅꤀, પተ꤀ ꤎ ꤕꤒꤌ𐌻 ተꤐ꤀ળ 𐌼ꤌተ𑀨) [<emoji document_id=5361609594894296234>🌕</emoji>]",
