            "[<emoji document_id=5361609594894296234>🌕</emoji>] ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨, પተ꤀ ተખ 𐌻꤀𑀋γωӄꤌ ꤕꤒꤌઞઞꤌꤎ, ӄ꤀ተ꤀рꤌꤎ 𐌼ꤕმ𐌻ꤕઞઞ꤀ ꤙꤣωꤕተ, ꤙ꤀ተ꤀𐌼γ પተ꤀ ꤕ𐌼γ પ𐌻ꤕઞ 𐌼꤀꤇ ꤐ 𐌟꤀ꤙꤕ 𐌼ꤕωꤌꤕተ) [<emoji document_id=5361609594894296234>🌕</emoji>]",
